import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { fetchAWSStatus } from '../features/awsServices/awsServicesSlice';
import { 
    Grid, 
    Card, 
    CardContent, 
    Typography, 
    CircularProgress,
    Alert,
    Box
} from '@mui/material';
import LogManagement from './LogManagement';

const Dashboard = () => {
    const dispatch = useDispatch();
    const { data, status, error } = useSelector((state) => state.awsServices);

    useEffect(() => {
        dispatch(fetchAWSStatus());

        const interval = setInterval(() => {
            dispatch(fetchAWSStatus());
        }, 30000);

        return () => clearInterval(interval);
    }, [dispatch]);

    if (status === 'loading' && !data) {
        return (
            <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
                <CircularProgress />
            </Box>
        );
    }

    if (status === 'failed') {
        return (
            <Alert severity="error">
                {error || 'Failed to fetch AWS services status'}
            </Alert>
        );
    }

    return (
        <Grid container spacing={3}>
            <Grid item xs={12} md={6}>
                <Card>
                    <CardContent>
                        <Typography variant="h6" gutterBottom>
                            EC2 Instances
                        </Typography>
                        {data?.ec2?.map((instance) => (
                            <Box key={instance.id} mb={2}>
                                <Typography>ID: {instance.id}</Typography>
                                <Typography>State: {instance.state}</Typography>
                                <Typography>Type: {instance.type}</Typography>
                                <Typography>
                                    Launch Time: {
                                        instance.launch_time ? 
                                        new Date(instance.launch_time).toLocaleString() : 
                                        'N/A'
                                    }
                                </Typography>
                            </Box>
                        ))}
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={12} md={6}>
                <Card>
                    <CardContent>
                        <Typography variant="h6" gutterBottom>
                            RDS Instances
                        </Typography>
                        {data?.rds?.map((db) => (
                            <Box key={db.id} mb={2}>
                                <Typography>ID: {db.id}</Typography>
                                <Typography>Status: {db.status}</Typography>
                                <Typography>Engine: {db.engine}</Typography>
                            </Box>
                        ))}
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={12} md={4}>
                <Card>
                    <CardContent>
                        <Typography variant="h6" gutterBottom>
                            Lambda Functions
                        </Typography>
                        {data?.lambda?.length ? (
                            data.lambda.map((func) => (
                                <Box key={func.name} mb={2}>
                                    <Typography>Name: {func.name}</Typography>
                                    <Typography>Runtime: {func.runtime}</Typography>
                                    <Typography>Memory: {func.memory}MB</Typography>
                                </Box>
                            ))
                        ) : (
                            <Typography color="textSecondary">No Lambda functions found</Typography>
                        )}
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={12} md={4}>
                <Card>
                    <CardContent>
                        <Typography variant="h6" gutterBottom>
                            ECS Clusters
                        </Typography>
                        {data?.ecs?.length ? (
                            data.ecs.map((cluster) => (
                                <Box key={cluster.name} mb={2}>
                                    <Typography>Name: {cluster.name}</Typography>
                                    <Typography>Status: {cluster.status}</Typography>
                                    <Typography>Tasks: {cluster.tasks}</Typography>
                                </Box>
                            ))
                        ) : (
                            <Typography color="textSecondary">No ECS clusters found</Typography>
                        )}
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={12} md={4}>
                <Card>
                    <CardContent>
                        <Typography variant="h6" gutterBottom>
                            EKS Clusters
                        </Typography>
                        {data?.eks?.length ? (
                            data.eks.map((cluster) => (
                                <Box key={cluster.name} mb={2}>
                                    <Typography>Name: {cluster.name}</Typography>
                                    <Typography>Status: {cluster.status}</Typography>
                                    <Typography>Version: {cluster.version}</Typography>
                                </Box>
                            ))
                        ) : (
                            <Typography color="textSecondary">No EKS clusters found</Typography>
                        )}
                    </CardContent>
                </Card>
            </Grid>
            <Grid item xs={12}>
                <LogManagement />
            </Grid>
        </Grid>
    );
};

export default Dashboard;
